    false,nt"url": null,nt"notes": "This is an archeological and paleoenvironmental
    study of Ash Meadows NWR. Archaeological and paleoenvironmental studies were conducted
    by the Quaternary Sciences Center of the Desert Research Institute (DRI) in the
    Ash Meadows National Wildlife Refuge (AMNWR), Nevada, under a cooperative agreement
    with the U.S. Fish and Wildlife Service (USFWS). Objectives of the research were
    to establish a basic understanding of the archaeology at Ash Meadows, describe the
    environmental context in which the sites were occupied, and to describe the Ash
    Meadows environment as it appeared before agricultural disturbance. Those objectives
    were pursued in three phases: photointerpretation, survey and reconnaissance, and
    test excavation and evaluation.",nt"license_title": "License Not Specified",nt"extras":
